    <div className="conteiner">
      <h1 className="title">BUSCADOR CEP</h1>

      <div className="conteinerInput">
        <input
        type="text"
        placeholder="Digite seu CEP"
        value={input}
        />

        <button className="buttonSearch">
          <FaSearch size={20} color='white'/>
        </button>
      </div>

      <main className='main'>
        <h2>CEP</h2>

        <span>RUA</span>
        <span>BAIRRO</span>
        <span>CIDADE</span>
        <span>ESTADO</span>
      </main>
    </div>
  );
}

export default App;
